    "Chemical analysis of sediments from the St. Lawrence River",nt"tracking_summary":
    {ntt"total": 11,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:41:47.820471",nt"name": "chemical-analysis-of-sediments-from-the-st-lawrence-river",nt"isopen":
    false,nt"url": null,nt"notes": "This report provides the results of a preliminary
    study of sediment contaminant levels in the St. Lawrence River. Sediment was sampled
    at 1 6 different locations from Clayton downstream to Massena, New York. Sediment
    was analyzed for inorganic and organic chemical residues. Polychlorinated biphenyl
    (PCB's) levels in Flynn Bay in the Clayton area were elevated and may reflect inputs
    of PCB's from Lake Ontario. Further study would be necessary to determine the spatial
    distribution and concentrations of PCB's in the Clayton area sediments. Elevated
    levels of PCB's in the Massena, New York area are consistent with industrial activity
    present in this area. Other organochlorines were not detected in this study. Polynuclear
    aromatic and aliphatic hydrocarbons were elevated at two sites of known industrial
    activity. The levels did not exceed Great Lakes criteria for heavily polluted sediments.
    Inorganic compounds exceeding Great Lakes criteria were detected at three of the
    16 sites sampled. Two sites in the Massena area are associated with industrial activity.
    The remaining site in the Chippewa Bay area showing elevated inorganic levels is
    a non-industrial site. It is also an important area for wintering Bald Eagles (Haliaeetus
    leucocephalus), an endangered species. Additional study would be necessary to determine
    the origin, spatial distribution, and biological impacts of inorganic contaminants
    in the Chippewa Bay area.",nt"license_title": "License Not Specified",nt"extras":
